import React, { useState } from 'react';

const NavigationBar = () => {
  const [activeItem, setActiveItem] = useState('home');
  const [animating, setAnimating] = useState('home');

  const handleClick = (id) => {
    setActiveItem(id);
    setAnimating(id);
    setTimeout(() => setAnimating(''), 2000);
  };

  // Custom Buildings icon with animation
  const BuildingsIcon = () => (
    <div className="relative w-6 h-6">
      <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" className="w-6 h-6 main-buildings">
        {/* Background skyscrapers */}
        <g className="skyscrapers">
          {/* Left skyscraper */}
          <path d="M6 6h3v15H6z" strokeWidth="1.5" />
          {/* Windows for left skyscraper */}
          <g className="windows-left opacity-0">
            <rect x="7" y="8" width="1" height="1" />
            <rect x="7" y="11" width="1" height="1" />
            <rect x="7" y="14" width="1" height="1" />
            <rect x="7" y="17" width="1" height="1" />
          </g>

          {/* Right skyscraper */}
          <path d="M15 4h3v17h-3z" strokeWidth="1.5" />
          {/* Windows for right skyscraper */}
          <g className="windows-right opacity-0">
            <rect x="16" y="6" width="1" height="1" />
            <rect x="16" y="9" width="1" height="1" />
            <rect x="16" y="12" width="1" height="1" />
            <rect x="16" y="15" width="1" height="1" />
            <rect x="16" y="18" width="1" height="1" />
          </g>
        </g>

        {/* Front house */}
        <g className="house">
          {/* House body */}
          <path d="M9 13h6v8H9z" strokeWidth="2" strokeLinejoin="round" />
          {/* House roof */}
          <path d="M8 13l4-3 4 3" strokeWidth="2" strokeLinejoin="round" />
          {/* House door */}
          <path d="M11 17h2v4h-2z" strokeWidth="1.5" />
          {/* House window */}
          <g className="house-window opacity-0">
            <rect x="11.5" y="14" width="1" height="1" />
          </g>
        </g>
      </svg>

      {/* Fixed blue dot */}
      <div className="absolute -right-1 bottom-0 w-3 h-3 bg-blue-500 rounded-full transform translate-y-1/4" />
    </div>
  );

  // Custom Bell icon with integrated bottom arc and clapper
  const CustomBell = () => (
    <div className="relative w-6 h-6">
      <svg viewBox="0 0 24 24" fill="none" stroke="currentColor" className="w-6 h-6">
        <path 
          d="M18 8A6 6 0 0 0 6 8c0 7-3 9-3 9h18s-3-2-3-9" 
          strokeWidth="2" 
          strokeLinecap="round" 
          strokeLinejoin="round"
        />
        <g className="bell-bottom">
          <path 
            d="M13.73 21a2 2 0 0 1-3.46 0" 
            strokeWidth="2" 
            strokeLinecap="round" 
            strokeLinejoin="round"
          />
          <line 
            x1="12" 
            y1="17" 
            x2="12" 
            y2="19.5" 
            strokeWidth="2.5" 
            strokeLinecap="round"
          />
        </g>
      </svg>
    </div>
  );

  const NavItem = ({ label, id, isProfile }) => (
    <button
      onClick={() => handleClick(id)}
      className={`relative flex flex-col items-center justify-center p-4 w-32 group 
        ${activeItem === id ? 'text-blue-500' : 'text-gray-400 hover:text-gray-300'}`}
    >
      <div className="relative">
        {isProfile ? (
          <div className={`relative w-6 h-6 ${animating === id ? 'animate-profile' : ''}`}>
            <img
              src="/api/placeholder/24/24"
              alt="Profile"
              className="w-6 h-6 rounded-full object-cover"
            />
            <div className="absolute -right-1 bottom-0 w-3 h-3 bg-green-500 rounded-full transform translate-y-1/4" />
          </div>
        ) : id === 'home' ? (
          <div className={animating === id ? 'animate-buildings' : ''}>
            <BuildingsIcon />
          </div>
        ) : (
          <div className={animating === id ? 'animate-bell' : ''}>
            <CustomBell />
          </div>
        )}
      </div>
      <span className="mt-1 text-sm font-medium">{label}</span>
    </button>
  );

  return (
    <div className="flex items-center justify-center w-full bg-gray-900 text-white p-2 rounded-lg">
      <style>
        {`
          @keyframes buildingsAnimation {
            0% { transform: scale(1); }
            20% { transform: scale(1.2); }
            80% { transform: scale(1.2); }
            100% { transform: scale(1); }
          }

          @keyframes windowsAppear {
            0% { opacity: 0; }
            30% { opacity: 0; }
            40% { opacity: 1; }
            80% { opacity: 1; }
            100% { opacity: 0; }
          }

          .animate-buildings .main-buildings {
            animation: buildingsAnimation 2s ease-in-out;
            transform-origin: bottom center;
          }

          .animate-buildings .windows-left,
          .animate-buildings .windows-right,
          .animate-buildings .house-window {
            animation: windowsAppear 2s ease-in-out;
            fill: currentColor;
          }

          .animate-buildings .windows-right {
            animation-delay: 0.2s;
          }

          .animate-buildings .house-window {
            animation-delay: 0.4s;
          }

          @keyframes bellAnimation {
            0% { transform: scale(1); }
            10% { transform: scale(1.2); }
            90% { transform: scale(1.2); }
            100% { transform: scale(1); }
          }

          @keyframes bellBottomSwing {
            0% { transform: rotate(0deg); }
            15% { transform: rotate(30deg); }
            30% { transform: rotate(-25deg); }
            45% { transform: rotate(20deg); }
            60% { transform: rotate(-15deg); }
            75% { transform: rotate(10deg); }
            90% { transform: rotate(-5deg); }
            100% { transform: rotate(0deg); }
          }

          .animate-bell > div {
            animation: bellAnimation 2s ease-in-out;
          }

          .animate-bell .bell-bottom {
            transform-origin: center 17px;
            animation: bellBottomSwing 2s ease-in-out;
          }

          @keyframes profileSpin {
            0% { transform: scale(1); }
            50% { transform: scale(1.1); }
            100% { transform: scale(1); }
          }

          .animate-profile {
            animation: profileSpin 2s ease-in-out;
          }
        `}
      </style>
      <nav className="flex items-center space-x-4">
        <NavItem label="Home" id="home" />
        <NavItem label="Notifications" id="notifications" />
        <NavItem label="You" id="you" isProfile={true} />
      </nav>
    </div>
  );
};

export default NavigationBar;
